trailingComments.value:
*
 * 通知客户端禁用 | 开启 Native View 的手势切换功能，用于web页面的横滚区域
 *
 * @param {number} params.touchState - 是否开启 0 / 1
 * @returns {Promise<*>}
 *
 * @example
 *  lib.exec('notify-horizontal-gesture', {
    params: {
      touchState: 1
    }
  }).catch((err) => {
    alert(`[refresh][notify-horizontal-gesture][error] ${JSON.stringify(err, null, 2)}`);
  });

